import React from 'react';
import { Parallax } from 'react-scroll-parallax';

import './style.scss';

import Summary from '../Summary';

const Main = () => (
  <div className="main_container">
    <div className="main_content">
      <Parallax
        offsetYMax={20}
        offsetYMin={-20}
        slowerScrollRate
        tag="figure"
      >
        <h2 className="main_title">PLAYERS GOTTA PLAY</h2>
      </Parallax>
      <Summary />
    </div>
  </div>
);

export default Main;
